  ngOnInit(): void {
    this.userform = this.fb.group({
      'identificador': new FormControl({ value: '', disabled: true }, Validators.required),
      'fecha_nacimiento': new FormControl({ value: '', disabled: true }, Validators.required),
      'pais': new FormControl({ value: '', disabled: true }, Validators.required),
      'religion': new FormControl({ value: '', disabled: true }, Validators.required),
      'estado_civil': new FormControl({ value: '', disabled: true }, Validators.required),
      'pueblo_indigena': new FormControl({ value: '', disabled: true }, Validators.required),
      'ocupacion': new FormControl({ value: '', disabled: true }, Validators.required),
      'sexo': new FormControl({ value: '', disabled: true }, Validators.required),
      'genero': new FormControl({ value: '', disabled: true }, Validators.required),
      'prevision': new FormControl({ value: '', disabled: true }, Validators.required)
    });

    if (this.identificador) {
      this.usuarioSeleccionado = this.pacientesGuardados.find(
        (p) => p.identificador === this.identificador
      );

      if (!this.usuarioSeleccionado) return; // evita errores

      setTimeout(() => {
        this.userform.patchValue({
          identificador: this.usuarioSeleccionado.identificador,
          fecha_nacimiento: this.usuarioSeleccionado.fecha_nacimiento,
          pais: this.usuarioSeleccionado.pais,
          religion: this.usuarioSeleccionado.religion,
          estado_civil: this.usuarioSeleccionado.estado_civil,
          pueblo_indigena: this.usuarioSeleccionado.pueblo_indigena,
          ocupacion: this.usuarioSeleccionado.ocupacion,
          sexo: this.usuarioSeleccionado.sexo,
          genero: this.usuarioSeleccionado.genero,
          prevision: this.usuarioSeleccionado.prevision
        });
      }, 0);


      this.solicitudesLaboratorioFiltro = this.solicitudesLaboratorio.filter(
        (p) => p.identificador_paciente === this.identificador
      );

      this.proximasAtencionesFiltro = this.proximasAtenciones.filter(
        (p) => p.identificador_paciente === this.identificador
      );

      this.anterioresAtencionesFiltroCDT = this.anterioresAtenciones.filter(
        (p) => p.identificador_paciente === this.identificador && p.ambito === 2
      );

      this.anterioresAtencionesFiltroURG = this.anterioresAtenciones.filter(
        (p) => p.identificador_paciente === this.identificador && p.ambito === 3
      );

      this.anterioresAtencionesFiltroHOSP = this.anterioresAtenciones.filter(
        (p) => p.identificador_paciente === this.identificador && p.ambito === 1
      );

      this.anterioresAtencionesFiltroDOM = this.anterioresAtenciones.filter(
        (p) => p.identificador_paciente === this.identificador && p.ambito === 4
      );

      this.anterioresAtencionesFiltroQUI = this.anterioresAtenciones.filter(
        (p) => p.identificador_paciente === this.identificador && p.ambito === 5
      );

      this.anterioresAtencionesSolicitud = this.anterioresAtenciones.filter(
        (p) => p.identificador_paciente === this.identificador
      );

      this.resultadosFiltroLAB = this.resultadosTotales.filter(
        (p) => p.identificador_paciente === this.identificador && p.tipo_solicitud === 1
      );


    }

    if (typeof window !== 'undefined' && localStorage) {
      const stored = localStorage.getItem('persona');

      if (stored) {
        this.persona = JSON.parse(stored);
        this.id_perfil = this.persona.id_perfil;

      }
    }
  }

  activarCampo(campo: number) {
    switch (campo) {
      case 1: this.userform.get('religion')?.enable(); break;
      case 2: this.userform.get('estado_civil')?.enable(); break;
      case 3: this.userform.get('pueblo_indigena')?.enable(); break;
      case 4: this.userform.get('ocupacion')?.enable(); break;
      case 5: this.userform.get('sexo')?.enable(); break;
      case 6: this.userform.get('genero')?.enable(); break;
    }

  }

  confirmar(campo: number) {
    console.log('campo, ', campo);

    switch (campo) {
      case 1:
        Swal.fire({
          title: '¿Deseas confirmar cita?',
          icon: 'question',
          showCancelButton: true,
          confirmButtonColor: '#38C870',
          cancelButtonColor: '#d33',
          confirmButtonText: 'Guardar'
        }).then((result) => {
          if (result.isConfirmed) {
            this.userform.disable();


            Swal.fire({
              icon: 'success',
              title: 'Cita Confirmada',
              timer: 1500,
              showConfirmButton: false
            });
          }
        });
        break;
      case 2:
        Swal.fire({
          title: '¿Deseas cancelar la cita?',
          icon: 'warning',
          showCancelButton: true,
          confirmButtonColor: '#38C870',
          cancelButtonColor: '#d33',
          confirmButtonText: 'Guardar'
        }).then((result) => {
          if (result.isConfirmed) {
            this.userform.disable();


            Swal.fire({
              icon: 'success',
              title: 'Cita Confirmada',
              timer: 1500,
              showConfirmButton: false
            });
          }
        });
        break;
    }
  }

  abrirPdf(atencion: any) {
    const base64 = atencion.pdf_base64;
    const byteCharacters = atob(base64);

    const byteNumbers = Array.from(byteCharacters).map(c => c.charCodeAt(0));
    const byteArray = new Uint8Array(byteNumbers);

    const blob = new Blob([byteArray], { type: 'application/pdf' });
    const url = URL.createObjectURL(blob);

    window.open(url, '_blank');
  }



