  guardarInformacion() {
    let hayError = false;

    Object.keys(this.userform.controls).forEach(key => {
      const control = this.userform.get(key);

      if (!control?.disabled && !this.userform.getRawValue()[key]) {
        hayError = true;
        Swal.fire({
          icon: 'error',
          title: 'Campos vacíos',
          text: 'Existen campos habilitados para editar que están vacíos.',
        });
      }
    });

    if (hayError) return;

    Swal.fire({
      title: '¿Guardar información?',
      text: 'Se actualizarán los datos ingresados.',
      icon: 'question',
      showCancelButton: true,
      confirmButtonColor: '#38C870',
      cancelButtonColor: '#d33',
      confirmButtonText: 'Guardar'
    }).then((result) => {
      if (result.isConfirmed) {
        this.userform.disable();


        Swal.fire({
          icon: 'success',
          title: 'Información guardada',
          timer: 1500,
          showConfirmButton: false
        });
      }
    });



  }

  // Métodos para el diálogo de retroalimentación
  abrirDialogoRetroalimentacion() {
    this.displayFeedbackDialog = true;
    this.feedbackType = null;
    this.initFeedbackForm();
  }

  initFeedbackForm() {
    this.feedbackForm = this.fb.group({
      // Campos comunes
      tipo: ['', Validators.required],

      // Campos para solicitud
      tipoSolicitud: [''],
      episodio: [''],
      correoSolicitud: ['', Validators.email],
      observacionSolicitud: [''],

      // Campos para reclamo/felicitaciones
      tipoRetroalimentacion: [''],
      rutEmisor: [''],
      identificarAfectado: [''],
      detalleRetroalimentacion: ['']
    });
  }

  onTipoChange(tipo: 'solicitud' | 'reclamo') {
    this.feedbackType = tipo;
    this.feedbackForm.patchValue({ tipo });

    // Resetear validaciones
    this.resetValidations();

    if (tipo === 'solicitud') {
      this.feedbackForm.get('tipoSolicitud')?.setValidators([Validators.required]);
      this.feedbackForm.get('episodio')?.setValidators([Validators.required]);
      this.feedbackForm.get('correoSolicitud')?.setValidators([Validators.required, Validators.email]);
      this.feedbackForm.get('observacionSolicitud')?.setValidators([Validators.required]);
    } else {
      this.feedbackForm.get('tipoRetroalimentacion')?.setValidators([Validators.required]);
      this.feedbackForm.get('rutEmisor')?.setValidators([Validators.required]);
      this.feedbackForm.get('identificarAfectado')?.setValidators([Validators.required]);
      this.feedbackForm.get('detalleRetroalimentacion')?.setValidators([Validators.required]);
    }

    this.feedbackForm.updateValueAndValidity();
  }

  resetValidations() {
    const fields = ['tipoSolicitud', 'episodio', 'correoSolicitud', 'observacionSolicitud',
      'tipoRetroalimentacion', 'rutEmisor', 'identificarAfectado', 'detalleRetroalimentacion'];
    fields.forEach(field => {
      this.feedbackForm.get(field)?.clearValidators();
      this.feedbackForm.get(field)?.setValue('');
    });
  }

  enviarRetroalimentacion() {
    if (this.feedbackForm.valid) {
      const formData = this.feedbackForm.value;

      Swal.fire({
        icon: 'success',
        title: this.feedbackType === 'solicitud' ? 'Solicitud enviada' : 'Retroalimentación enviada',
        text: 'Su información ha sido registrada correctamente.',
        timer: 2000,
        showConfirmButton: false
      });

      this.displayFeedbackDialog = false;
      this.feedbackForm.reset();
      this.feedbackType = null;
    } else {
      Swal.fire({
        icon: 'error',
        title: 'Formulario incompleto',
        text: 'Por favor complete todos los campos requeridos.'
      });
    }
  }

  openDialog() {
    this.displayDialog = true;
  }

  get isSolicitudValid(): boolean {
    const valid = !!(
      this.selectedSolicitud &&
      this.selectedEpisodio &&
      this.emailSolicitud?.trim() !== '' &&
      this.detalleSolicitud?.trim() !== ''
    );

    console.log('isSolicitudValid =', valid, {
      selectedSolicitud: this.selectedSolicitud,
      selectedEpisodio: this.selectedEpisodio,
      emailSolicitud: this.emailSolicitud,
      detalleSolicitud: this.detalleSolicitud,
    });

    return valid;
  }


  get isReclamoValid(): boolean {
    return !!(this.selectedReclamo &&
      this.rutEmisor && this.rutEmisor.trim() !== '' &&
      this.afectado && this.afectado.trim() !== '' &&
      this.detalleReclamo && this.detalleReclamo.trim() !== '');
  }

